import React, { useState } from 'react';
import { Link } from "react-router-dom";
import './../starterstyles.css';

function SampleList () {


    return (
        <>
            <main>
                <h2 className="title">Your Song Samples</h2>

                <section className="sample">
                    <div className="card">
                        <div className="song-details">
                            <h3>Song Name</h3>
                            <p>Date Created</p>
                        </div>
                        <div class="button-group-container">
                            <a href="#" className="button">Share</a>
                            <button className="button">Preview</button>
                            <a href="#" className="bright-button">Edit</a>
                        </div>
                    </div>
                </section>

                <div className="create-card">
                <a href="#" className="full-button">Create Sample</a>
                </div>
            </main>
        </>
    );
}

export default SampleList;
